import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

import LifeCycle from "./components/LifeCycle";

let n = 0;

ReactDOM.render(
  <React.StrictMode>
    <LifeCycle n={n} />
    <button onClick={() => n++}>n+1</button>
  </React.StrictMode>,

  document.getElementById("root")
);
